    "2015-10-28T14:52:13.531670",nt"name": "tiger-line-shapefile-2015-nation-u-s-current-necta-division-national",nt"isopen":
    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation.nn               New England City and Town Area (NECTA) Divisions subdivide
    a NECTA containing a single core urban area that has a population of at least 2.5
    million ton               form smaller groupings of cities and towns.  NECTA Divisions
    are defined by the Office of Management and Budget (OMB) and consist of a main city
    or townn               that represents an employment center, plus adjacent cities
    and towns associated with the main city or town through commuting ties.  Each NECTA
    Divisionn               must contain a total population of 100,000 or more.  Because
    NECTA Divisions represent subdivisions of larger NECTAs, it is not appropriate to
    rank orn               compare NECTA Divisions with NECTAs.  Not all NECTAs with
    urban areas of this size will contain NECTA Divisions. nn               The NECTA
    Divisions boundaries are those defined by OMB based on the 2010 Census and published
    in 2013.n            ",nt"license_title": null,nt"extras": [{ntt"key":
